  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 49 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '一个伤口可以有多个潜行/窦道/瘘管\r\n潜行：开始点、长度\r\n窦道：开始点、结束点、长度\r\n瘘管：开始点、备注、长度' ROW_FORMAT = Compact;

